import React from 'react'
import './Poster.css'
// import {API_KEY} from "../../constants/Constants"
import axios from 'axios'


function Poster(props) {
   
    const movieHandle = (id) => {
        console.log(id)
        axios
          .get(
            `https://api.themoviedb.org/3/movie/${id}/videos?api_key=f0bde51db52e9c6388d864e6ab433ac6&language=en-US`
          )
          .then((Response) => {
              if (Response.data.results.length !== 0) {
               console.log(Response.data.results);
           }
          })
          .catch((err) => {
            console.log("err", err);
          });
    }
     
    return (
        <img onClick={movieHandle(props.youtubeId)} src={props.src} alt="" />
    )
}

export default Poster
